    return (
        <div className="heading">
            <div className="heading__text">
                <h1>Hi! I'm Jesse</h1>
                <h3>Software Engineer, Entrepreneur, Investor</h3>
            </div>
            <img src={MeImage} alt={"An image of me."} width="300"/>
        </div>
    )
}
